bolabit:                                                                                                                                
.word 0x00f70b0b                                                                                                                               

# VETORES COM PARAMETROS DOS PERSONAGENS

# Ordem dos parametros do vetor:
# base, altura, x inicial, y inicial, x final, y, final, offset inicio, variavel

# vetor 1: endereco 0x10010000 + 65588
.word 12 1 59 55 100 10 65536 15 
# vetor 2: endereco 0x10010000 + 65620
.word 1 1 62 54 90 18 65584 54


# ------------------------------------------------------------

# PROGRAMA                                                                                                        
                                                                                                                                                                                                                                                                                                                                    
.text 

main:

# Parametros globais:
	
	addi $25 $0 128 # quantidade de colunas do cenario
	addi $30 $0 64 # quantidade de linhas do cenario
	mul $26 $25 $30 # area do cenario
	addi $27 $0 29 # assets + vetor 
	addi $6 $0 512 # width do display
	addi $7 $0 4 # porporcao width do display
	
# Chamada de funcao para guardar cenario, personagens e vetores na memoria
	add $10, $27, $26 # contador da iteracao
	add $8 $0 $10
	sll $8 $8 2
	addi $8 $8 0x10010000
	addi $8 $8 -4 # local a ser lido
	add $24 $0 $10
	sll $24 $24 2
	add $24 $24 $8 
	sll $1 $27 2
	sub $24 $24 $1 # local a ser armazenado
	jal store
	
# Chamada de funcao para carregar cenario na tela
	lui $8, 0x1001 # local a ser escrito
	add $24 $0 $26
	sll $24 $24 2
	add $24 $24 $8 # local a ser lido
	addi $10, $0, 0 # contador
	jal load
	
# Ponteiros para vetores dos personagens 
	lui $2 0x1001
	addi $1 $0 65588 # personagem1[0]
	add $2 $2 $1
	
	lui $3 0x1001
	addi $1 $0 65620 # personagem2[0]
	add $3 $3 $1

	
# loop da animacao da tela:
	# desenha todos personagens
	# aguarda um tempo
	# apaga todos os personagens 
	# controla movimento dos personagens
animacao:
	bne  $0, $0, fimanimacao # comparacao de posicao
	
# carregamento de parametros do personagem 1: protagonista
	lw $22 0($2) # base  
	lw $23 4($2) # altura 
	lw $18 8($2) # x inicial
	lw $19 12($2) # y inicial
	lw $20 16($2) # x final
	lw $21 20($2) # y final
	lw $28 24($2) # inicio 
	lw $29 28($2) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# carregamento de parametros de personagem 2: npc
	lw $22 0($3) # base  
	lw $23 4($3) # altura 
	lw $18 8($3) # x inicial
	lw $19 12($3) # y inicial
	lw $20 16($3) # x final
	lw $21 20($3) # y final
	lw $28 24($3) # inicio
	lw $29 28($3) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# tempo de espera da animacao
	addi $8, $0, 5000 # taxa de tempo de espera
	jal timer
	
# apagar persoangens da tela
pers1:	

# carregamento de parametros do personagem 1: protagonista
	lw $22 0($2) # base  
	lw $23 4($2) # altura 
	lw $18 8($2) # x inicial
	lw $19 12($2) # y inicial
	lw $20 16($2) # x final
	lw $21 20($2) # y final
	lw $28 24($2) # inicio
	lw $29 28($2) # extra

# chamada de funcao para apagar personagem
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo
	

# controle manual de personagem:	
controle:
	lui $8, 0xffff # tecla foi digitada
	lw $11, 0($8)
	beq $11, $0, naodig # se != 0 digitou algo
	addi $12, $0, 'd'
	lw $13, 4($8) # tecla digitada pelo usuario
	beq $12, $13, dir # se for d 
	addi $12, $0, 'a'
	beq $12, $13, esq # se for a
	addi $12, $0, 's'
	beq $12, $13, baixo # se for s
	addi $12, $0, 'w'
	beq $12, $13, cima # se for w 
	addi $12, $0, ' '
	beq $12, $13, end # se for ' '
	j naodig
	
# caso queira alterar a velocidade do movimento aumente os valores
dir:  	
	bge $18 115 fimpers1 	
	addi $18, $18, 2 # incrementa endereco pra direita
	j naodig
esq: 	
	blt $18 3 fimpers1 
	addi $18, $18, -2 # incrementa endereco pra esquerda
	j naodig
baixo: 	
	#bgt $19 60 fimpers1 
	#addi $19, $19, 3 # incrementa endereco pra baixo 
	j naodig
cima:	
	#blt $19 3 fimpers1 
	#addi $19, $19, -3 # incrementa endereco pra cima
	j naodig
	
naodig:
	# aqui pode-se fazer algo quando não há entrada de teclas
	
# continua para o proximo personagem
fimpers1:
	
# armazenamento de parametros do personagem 1: protagonista
	sw $22 0($2) # base  
	sw $23 4($2) # altura 
	sw $18 8($2) # x inicial
	sw $19 12($2) # y inicial
	sw $20 16($2) # x final
	sw $21 20($2) # y final
	sw $28 24($2) # inicio
	sw $29 28($2) # extra
	
pers2:

# carregamento de parametros de personagem 2: npc
	lw $22 0($3) # base  
	lw $23 4($3) # altura 
	lw $18 8($3) # x inicial
	lw $19 12($3) # y inicial
	lw $20 16($3) # x final
	lw $21 20($3) # y final
	lw $28 24($3) # inicio
	lw $29 28($3) # extra
	
# chamada de funcao para apagar personagem
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo
	
# controle automatico de movimento de personagem
	
	
	
ida2.2:	beq $19, $21 troca2.2 # troca x inicial e final
	bgt $19, $21 volta2.2 # loop da ida
	addi $19, $19, 1 # variacao do movimento

	j fimpers2
troca2.2:
	add $21 $0 $29 # y final = y inicial
	add $29 $0 $19 # extra = y final
	j fimpers2
volta2.2:	
	blt $19 $21 ida2.2 # loop da volta
	addi $19 $19, -1 # variacao do movimento

	
	
fimpers2:
	
# armazenamento de parametros do personagem 2: npc
	sw $22 0($3) # base  
	sw $23 4($3) # altura 
	sw $18 8($3) # x inicial
	sw $19 12($3) # y inicial
	sw $20 16($3) # x final
	sw $21 20($3) # y final
	sw $28 24($3) # inicio
	sw $29 28($3) # extra

pers3:	

	# aqui pode-se incrementar mais personagens no jogo
	
	j animacao

fimanimacao:
	
end:
	addi $2, $0, 10 # encerra o programa
	syscall
	
# funcao para carregar cenario na tela
# paramentros:
	# local a ler $24
	# local a escrever $8
	# contador $10
load:	
	lw $9, 0($24)
	sw $9, 0($8)
	addi $8, $8, 4
	addi $24, $24, 4
	addi $10, $10, 1
	bne $10, $26, load
	jr $31
	
# funcao para guardar cenario e personagem na memoria
# paramentros:
	# local a ser lido $8
	# local a ser armazenado $24
	# contador $10
store:
	lw $9, 0($8)
	sw $9, 0($24)
	addi $8, $8, -4
	addi $24, $24, -4
	addi $10, $10, -1
	bne $10, 0, store
	jr $31

# funcao para desenhar personagem na tela
# parametros:
	# endereco inicial: $8 
	# Largura do personagem: $9
	# altura do personagem: $10
	# Saber o x: $11
	# Saber o y: $12
personagem:  
	lui $15, 0x1001
	sll $11, $11, 2 # enderecos a percorrer no eixo x
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # enderecos a percorrer no eixo y
	mul $12, $12, $1 
	add $15, $15, $11
	add $15, $15, $12 # posicao inicial a ser desenhada
	add $13, $0, $9 # quantidade de colunas
laco1:	beq $10, $0, fimlaco1
laco2:	beq $9, $0, fimlaco2
	lw $14, 0($8) # local a ler
	sw $14, 0($15) # local a desenhar.
	addi $8, $8, 4 
	addi $15, $15, 4
	addi $9, $9, -1 # colunas--
	j laco2
fimlaco2:   
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # enderecos a percorrer no eixo y
	add $15, $15, $1
	sll $16, $13, 2 
	sub $15, $15, $16 # volta para a coluna inicial
	add $9, $0, $13 # valor inicial de colunas 
	addi $10, $10, -1 # linhas--  
	j laco1  
fimlaco1: 
	jr $31
            
# funcao para carregar parte do cenario.
# parametros: 
	# Largura do personagem: $9
	# altura do personagem: $10
	# Saber o x: $11
	# Saber o y: $12
carregafundo:  
	lui $15, 0x1001
	sll $11, $11, 2 # enderecos a percorrer no eixo x
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # enderecos a percorrer no eixo y
	mul $12, $12, $1 
	add $15, $15, $11
	add $15, $15, $12 # posicao inicial a ser desenhada
	add $13, $0, $9 # quantidade de colunas        
	lui $8, 0x1001 
	add $8, $8, $11
	add $8, $8, $12 # posicao inicial a ser desenhada
	add $12, $0, $26
	sll $12, $12, 2
	add $8, $8, $12
	    
laco1.1:
	beq $10, $0, fimlaco1.1
laco2.1:
	beq $9, $0, fimlaco2.1
	lw $14, 0($8) # local a ler
	sw $14, 0($15) # local a desenhar.
	addi $8, $8, 4 
	addi $15, $15, 4
	addi $9, $9, -1 # colunas--
	j laco2.1
fimlaco2.1:    
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # enderecos a percorrer no eixo y
	add $15, $15, $1
	add $8, $8, $1
	sll $16, $13, 2 
	sub $8, $8, $16 # volta para a coluna inicial
	sub $15, $15, $16 
	add $9, $0, $13 # valor inicial de colunas
	addi $10, $10, -1 # linahs--  
	j laco1.1  
fimlaco1.1: 
	jr $31
	
# funcao para passar tempo.
# parametros:
	# taxa de espera: $8          
timer:	
	beq $8, $0, fimtimer
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	addi $8, $8, -1
	j timer
fimtimer: 
	jr $31
